import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import HomePage from './pages/HomePage';
import AboutUsPage from './pages/AboutUsPage';
import MinistriesPage from './pages/MinistriesPage';
import CoursesPage from './pages/CoursesPage';
import GetInvolvedPage from './pages/GetInvolvedPage';
import PrayerPointsPage from './pages/PrayerPointsPage';
import DonatePage from './pages/DonatePage';
import EventsPage from './pages/EventsPage';
import BlogNewsPage from './pages/BlogNewsPage';
import ContactUsPage from './pages/ContactUsPage';
import Header from './components/Header';
import Footer from './components/Footer';

function App() {
  return (
    <Router>
      <Header />
      <Switch>
        <Route path="/" exact component={HomePage} />
        <Route path="/about-us" component={AboutUsPage} />
        <Route path="/our-ministries" component={MinistriesPage} />
        <Route path="/upcoming-courses" component={CoursesPage} />
        <Route path="/get-involved" component={GetInvolvedPage} />
        <Route path="/prayer-points" component={PrayerPointsPage} />
        <Route path="/donate" component={DonatePage} />
        <Route path="/events" component={EventsPage} />
        <Route path="/blog-news" component={BlogNewsPage} />
        <Route path="/contact-us" component={ContactUsPage} />
      </Switch>
      <Footer />
    </Router>
  );
}

export default App;
